import dialogList from '../constants/dialog.js';
export default function dialog(state = dialogList, action) {
  if (action.type === 'FETCH_DIALOG_SUCCSESS'){
    console.log(`Данные успешно закгрузились`)
    return action.dialogs
  }
  return state;
}
